    return (
      <ul className="flex flex-1 justify-center items-center gap-16 max-lg:hidden">
        <li className=" ">
          <Link
            to="/home"
            className="font-monsterrat leading-normal text-lg text-slate-gray"
          >
            Home
          </Link>
        </li>
        <li className="flex flex-1 justify-center items-center gap-16 max-lg:hidden">
          <Link to="/your-meetup">Your Meetup</Link>
        </li>
